export default {
	isCurrentPage: (page) => {
		if(appsmith.store.page === page) return true;
		return false;
	},

	setCurrentPage: (page) => {
		storeValue('page', page);
		navigateTo(page);
	},

	fetchFile: () => {
		switch(tab_file_types.selectedTab) {
			case 'Bank Payment Data':
				fetch_files.run();
				break;
			case 'Bank Refund Data':
				fetch_bank_refund_files.run();
				break;
			case 'Merchant Order Data':
				break;
		}
	},

	downloadFile: (fileUid) => {
		storeValue('fileUid', fileUid);
		download_file.run();
	}
}
